const INITIAL_STATE = {
    cartProducts: null,
    totalPayment: 0
}

export function CartReducer(state = INITIAL_STATE, action) {
    switch (action.type) {
        case 'ADD_PRODUCT':
            return {
                ...state,
                cartproducts: [...state.products, action.product]
            }
    }
}
